import Card from 'react-bootstrap/Card'

function ProjectCard(props){
    return(
        <Card className="crd-style p-4" style={{ border: 'none', height: 'auto', marginRight: 'auto', marginLeft: 'auto' }}>
            <Card.Img style={{
                maxWidth: '400px',
                height: 'auto',
                marginLeft: 'auto',
                marginRight: 'auto',
                boxShadow: '0px 0px 20px 1px #CCC',
                borderRadius: '10px',
            }} variant="top" src={props.image} />
            <Card.Body>
                <Card.Title>Project Title</Card.Title>
                <small>[project Dates]</small>
                <p>Project Type</p>

                <Card.Text>
                    project headline
                </Card.Text>
                <a className = "" href = "https://www.google.com">Learn More</a>
            </Card.Body>
        </Card>
    );
}

export default ProjectCard;
